index d09bb639103..a04b4d08ace 100644
--- a/Objects/listobject.c
+++ b/Objects/listobject.c
@@ -3382,7 +3382,14 @@ list_richcompare_impl(PyObject *v, PyObject *w, int op)
     }

     /* Compare the final item again using the proper operator */
-    return PyObject_RichCompare(vl->ob_item[i], wl->ob_item[i], op);
+    PyObject *vitem_cmp = vl->ob_item[i];
+    PyObject *witem_cmp = wl->ob_item[i];
+    Py_INCREF(vitem_cmp);
+    Py_INCREF(witem_cmp);
+    PyObject *result = PyObject_RichCompare(vitem_cmp, witem_cmp, op);
+    Py_DECREF(vitem_cmp);
+    Py_DECREF(witem_cmp);
+    return result;
 }

